    [],nt"revision_timestamp": "2016-07-27T22:48:53.759445",nt"name": "contaminant-assessment-of-common-terns-in-the-gulf-of-maine-eaf69",nt"isopen":
    false,nt"url": null,nt"notes": "In 2001, developmental abnormalities and
    low productivity were reported in common tern (Sterna hirundo) chicks from three
    islands on the Maine coast - Stratton Island, Jenny Island, and Pond Island. Newborn
    terns were too weak to hatch or unable to completely emerge from their eggshell.
    Others birds that were able to hatch quickly developed combinations of the following
    symptoms: swollen or encrusted eyes, bloody nares, patchy feather development, and
    necrotic skin at the base of the bill and legs. Chicks shook involuntarily or were
    extremely lethargic. At one island, there was an unconfirmed report of malformed
    bills in a few chicks. Most affected tern chicks died within five to seven days
    of hatching. Diagnostic examinations for diseases and parasites were conducted by
    the National Wildlife Health Center (NWHC), but were inconclusive. Acting on a recommendation
    by the NWHC, a screening-level contaminant survey was initiated by the U.S. Fish
    and Wildlife Service and its seabird restoration partners in 2004. Some contaminants
    such as dioxins, polychlorinated biphenyls, DDT, and mercury have been linked in
    previous tern studies to developmental abnormalities or reduced productivity.",nt"license_title":
